export const TodoItem = () => {
  let items = [
    {
      sno: 1,
      task: "Job1",
      desc: "Do job1",
    },
    {
      sno: 2,
      task: "Job2",
      desc: "Do job2"
    },
    {
      sno: 3,
      task: "Job3",
      desc: "Do job3"
    }
  ]

  return (
    <div>
      <h1>{items[0].task} </h1>
      <p> {items[0].desc} </p>
    </div>

  )
}
